  //The saveSetting function handles the saving or editing of data entry settings.
  saveSetting(data) {
    if (this.dataEntrySetting.id === undefined) {
      this.dataEntrySetting.manageDataPointSubCategoriesID = this.SubCatAllData.id;
      this.trackingService.postDataEntrySetting(this.dataEntrySetting).subscribe({
        next: response => {
          if (response === true) {
            this.activeindex = 0;
            this.notification.showSuccess('Setting Added successfully', 'Success');
          } else {
            this.notification.showWarning('Setting Added failed', 'Warning');
          }
        },
        error: err => {
          this.notification.showError('Setting added failed.', 'Error');
          console.error('errrrrrr>>>>>>', err);
        },
        complete: () => console.info('Setting Added')
      });
    } else {
      this.dataEntrySetting.manageDataPointSubCategoriesID = this.SubCatAllData.id;
      this.trackingService.putDataEntrySetting(this.dataEntrySetting.id, this.dataEntrySetting).subscribe({
        next: response => {
          if (response == true) {
            this.activeindex = 0;
            this.notification.showSuccess('Setting edited successfully', 'Success');
          }
        },
        error: err => {
          this.notification.showError('Setting editing failed.', 'Error');
          console.error('errrrrrr>>>>>>', err);
        },
        complete: () => console.info('Setting Edited')
      });
    }
  }
